import React, { useState } from "react";
import { NavE, NavIcons, NavItem, NavLogo, NavMenu } from "./Nav.element";
import { FaTimes, FaBars } from "react-icons/fa";

const Nav = () => {
  const [isMobile, setIsMobile] = useState(false);
  return (
    <NavE>
      <NavLogo src="images/logo.svg"></NavLogo>
      .
      <NavIcons isMobile={isMobile} onClick={() => setIsMobile((p) => !p)}>
        {!isMobile ? <FaBars /> : <FaTimes />}
      </NavIcons>
      <NavMenu isMobile={isMobile}>
        <NavItem>About</NavItem>
        <NavItem>Download</NavItem>
        <NavItem>Pricing</NavItem>
      </NavMenu>
    </NavE>
  );
};

export default Nav;
